import { computeHeadingLevel } from "@testing-library/react";
import { upload } from "@testing-library/user-event/dist/upload";
import React, { useEffect, useState } from "react";

const Search= () =>{

const [data, setData] = useState() ;

const getData = async ()=>{
   
        const data = new FormData();
        data.append("image_input",  {data});
        
        const options = {
            method: 'POST',
            headers: {
                'X-RapidAPI-Key': 'd5b7d1e676msh052563ca3875628p152f44jsnca03cd34b509',
                'X-RapidAPI-Host': 'face-detection-and-analysis.p.rapidapi.com'
            },
            body: data
        };
        
        fetch('https://face-detection-and-analysis.p.rapidapi.com/face_analysis', options)
            .then(response => response.json())
            .then(response => console.log(response))
            .catch(err => console.error(err));
   
}

useEffect(()=>{
getData() ;
}, [data]); 


    return (
<>
<div className="container">
    <h1>Upload file</h1>
    <input type="file" onChange={(e)=>setData(e.target.files)}  name="img"/>
</div>
</>

    )
}
export default Search ;
